```javascript
const myDict = {
    apple: 'fruit',
    banana: 'fruit',
    cherry: 'fruit',
    date: 'fruit',
    eggplant: 'vegetable'
};

// Sort the dictionary by key alphabetically
const sortedDict = Object.entries(myDict).sort((a, b) => a[0].localeCompare(b[0]));

// Iterate through the sorted dictionary and print the keys and values
for (const [key, value] of sortedDict) {
    console.log(`${key}: ${value}`);
}
```

This script will output:

```
apple: fruit
banana: fruit
cherry: fruit
date: fruit
eggplant: vegetable
```
